import React from "react";
import Navigation from "../components/Navigation";

import logo from '../imgs/53139474_101025971061399_6126230540858163200_n.jpg'




function Home() {

    return (
        <>
            <Navigation />
            <div className="container flex m-16">
                <h1 className = 'text-3xl'>Profesionales en Seguros y Finanzas</h1>
                <img
                    src={logo}
                    width='200'
                    height='200'


                    alt="" />



            </div>
        </>

    )
}
export default Home;
